import React, { Component } from "react";
 
class Home extends Component {
  render() {
    return (
      <div>
        <h2>WELCOME to XYZ Pharmacy</h2>
        <br></br>
        <p>This is a one stop solution to all the Pharmacies. Here order your medicine from our place
            and get it as soon as possible.
        </p>
 
        <p>A dummy project developed by a bunch of engineers..Deploying.....</p>
      </div>
    );
  }
}
 
export default Home;
